import React from 'react';

const Home =()=>{
  return(<>
  <div className="container-fluid">
    <div className="row">
      <div className="col-10 mx-auto">
        <div className="col-md-6 order-2 order-lg-1 pt-5 pt-lg-o">
          <h1> Grow your Business with<span> Rahul Bisht</span></h1>
          <h2 className="my-3">We are the team of talented Developer making Websites. </h2>
        </div>
      </div>
    </div>
  </div>
  </>);
}

export default Home;
